	<style>
		#AppsContainer,
		#CalculatorsContainer,
		#BlogsContainer,
		#EmailThemesContainer {
			opacity: 0;
			transition: opacity 0.35s ease-in-out;
		}

		#AppsContainer.is-active,
		#CalculatorsContainer.is-active,
		#BlogsContainer.is-active,
		#EmailThemesContainer.is-active {
			opacity: 1;
			transition: opacity 0.35s ease-in-out;
		}

		#pointer g {
			opacity: 0;
		}

		#AppsMenuLine,
		#CalculatorsMenuLine,
		#BlogsMenuLine {
			opacity: 0;
		}

		#AppsMenu,
		#CalculatorsMenu,
		#BlogsMenu,
		#EmailThemesMenu {
			transition: fill 0.35s ease-in-out;
		}

		#AppsMenu.is-active,
		#CalculatorsMenu.is-active,
		#BlogsMenu.is-active,
		#EmailThemesMenu.is-active {
			fill: #2C40CE;
			transition: fill 0.35s ease-in-out;
		}
	</style>

<script src="js/TweenMax.min.js"></script>

<script >

	function blogSectionCB() {
		document.querySelector('#EmailThemesMenu').classList.remove('is-active');
		document.querySelector('#BlogsMenu').classList.add('is-active');

		document.querySelector('#EmailThemesContainer').classList.remove('is-active');
		document.querySelector('#BlogsContainer').classList.add('is-active');
	}

	function CalculatorsSectionCB() {
		document.querySelector('#BlogsMenu').classList.remove('is-active');
		document.querySelector('#CalculatorsMenu').classList.add('is-active');

		document.querySelector('#BlogsContainer').classList.remove('is-active');
		document.querySelector('#CalculatorsContainer').classList.add('is-active');
	}

	function AppsSectionCB() {
		document.querySelector('#CalculatorsMenu').classList.remove('is-active');
		document.querySelector('#AppsMenu').classList.add('is-active');

		document.querySelector('#CalculatorsContainer').classList.remove('is-active');
		document.querySelector('#AppsContainer').classList.add('is-active');
	}

	function EmailThemesSectionCB() {
		document.querySelector('#AppsMenu').classList.remove('is-active');
		document.querySelector('#EmailThemesMenu').classList.add('is-active');

		document.querySelector('#AppsContainer').classList.remove('is-active');
		document.querySelector('#EmailThemesContainer').classList.add('is-active');
	}

	let tl = new TimelineMax({delay: 3, repeatDelay: 3, repeat: -1});

	tl
			.set('#pointer #topMenuPointerET, #pointer #topMenuPointerB, #pointer #topMenuPointerC, #pointer #topMenuPointerET', {opacity: '0', transformOrigin: 'center'})
			.set('#AppsMenuLine, #CalculatorsMenuLine, #BlogsMenuLine', {opacity: '0', scaleY: 0, transformOrigin: 'center bottom'})
	;

	tl
		.to('#pointer #topMenuPointerB', 0.75, {opacity: 1, y: '-10', ease: Power2.linear})
		.to('#pointer #topMenuPointerB', 0.2, {scale: 0.8, ease: Power2.linear})
		.to('#pointer #topMenuPointerB', 0.2, {scale: 1, ease: Power2.linear, onComplete: blogSectionCB})
		.to('#pointer #topMenuPointerB', 0.2, {opacity: 0, ease: Power2.linear}, '-=0.2')
		.to('#EmailThemesMenuLine', 0.2, {opacity: 0, scaleY: 0, ease: Power2.linear}, '-=0.2')
		.to('#BlogsMenuLine', 0.2, {opacity: 1, scaleY: 1, ease: Power2.linear}, '-=0.2')
		.to('#Other', 3, {opacity: 1, scaleY: 1, ease: Power2.linear})
		.to('#pointer #topMenuPointerC', 0.75, {opacity: 1, y: '-10', ease: Power2.linear})
		.to('#pointer #topMenuPointerC', 0.2, {scale: 0.8, ease: Power2.linear})
		.to('#pointer #topMenuPointerC', 0.2, {scale: 1, ease: Power2.linear, onComplete: CalculatorsSectionCB})
		.to('#pointer #topMenuPointerC', 0.2, {opacity: 0, ease: Power2.linear}, '-=0.2')
		.to('#BlogsMenuLine', 0.2, {opacity: 0, scaleY: 0, ease: Power2.linear}, '-=0.2')
		.to('#CalculatorsMenuLine', 0.2, {opacity: 1, scaleY: 1, ease: Power2.linear}, '-=0.2')
		.to('#Other', 3, {opacity: 1, scaleY: 1, ease: Power2.linear})
		.to('#pointer #topMenuPointerA', 0.75, {opacity: 1, y: '-10', ease: Power2.linear})
		.to('#pointer #topMenuPointerA', 0.2, {scale: 0.8, ease: Power2.linear})
		.to('#pointer #topMenuPointerA', 0.2, {scale: 1, ease: Power2.linear, onComplete: AppsSectionCB})
		.to('#pointer #topMenuPointerA', 0.2, {opacity: 0, ease: Power2.linear}, '-=0.2')
		.to('#CalculatorsMenuLine', 0.2, {opacity: 0, scaleY: 0, ease: Power2.linear}, '-=0.2')
		.to('#AppsMenuLine', 0.2, {opacity: 1, scaleY: 1, ease: Power2.linear}, '-=0.2')
		.to('#Other', 3, {opacity: 1, scaleY: 1, ease: Power2.linear})
		.to('#pointer #topMenuPointerET', 0.75, {opacity: 1, y: '-10', ease: Power2.linear})
		.to('#pointer #topMenuPointerET', 0.2, {scale: 0.8, ease: Power2.linear})
		.to('#pointer #topMenuPointerET', 0.2, {scale: 1, ease: Power2.linear, onComplete: EmailThemesSectionCB})
		.to('#pointer #topMenuPointerET', 0.2, {opacity: 0, ease: Power2.linear}, '-=0.2')
		.to('#AppsMenuLine', 0.2, {opacity: 0, scaleY: 0, ease: Power2.linear}, '-=0.2')
		.to('#EmailThemesMenuLine', 0.2, {opacity: 1, scaleY: 1, ease: Power2.linear}, '-=0.2')
	;

</script>

</html>
